import Exercicio2 from './Exercicio2';

const Exercicio1 = () => {

const nomes = ['Alice', 'Bob', 'Carol', 'David'];

return (
    <div>
      {nomes.map((item, index) => (
        <div key={index}>
          <li>{item}</li>
        </div>
      ))}
      <hr/>
      {Exercicio2.map((item) => (
        <div key={item.id}>
          <li>{item.name}</li>
          <li>{item.banda}</li>
          <li>{item.talento}</li>
        </div>
      ))}
    </div>
  );
};

export default Exercicio1
